import React from 'react';
import { Link } from 'react-router-dom';

const Header = (props) => {
    return (
        <nav className="nav-wrapper blue darken-3">
            
            <div>
            <Link to='/' className="brand-logo"> React and Spring-Boot</Link>
            </div>
        </nav>
    )
}

export default (Header);
